    public class DDFBuilder
    {
        readonly FileDdf _fileDdf;
        readonly FieldDdf _fieldDdf;
        readonly IndexDdf _indexDdf;
        readonly FieldextDdf _fieldExt;

        readonly List<BtrieveEntity> _entities = new List<BtrieveEntity>();

        bool _underTests = false;
        IEntityDataProvider _db;
        string _resultPath;
        bool _useCaptions;
        string _filePrefix;
        public DDFBuilder(IEntityDataProvider db, string resultPath, bool useCaptions,string filePrefix = "")
        {
            _filePrefix = filePrefix;
            _useCaptions = useCaptions;
            _db = db;
            _resultPath = resultPath;
            _fileDdf = new FileDdf(db, resultPath);
            _fieldDdf = new FieldDdf(db, resultPath);
            _indexDdf = new IndexDdf(db, resultPath);
            _fieldExt = new FieldextDdf(db, resultPath);
        }

        internal void InitForTesting()
        {
            _underTests = true;
        }

        public void AddEntity(BtrieveEntity entity)
        {
            _entities.Add(entity);
        }
        class BlobInfo
        {
            public int fieldId;
            public int length;
        }
        public bool Exists()
        {
            return _fileDdf.Exists() || _fieldDdf.Exists() || _indexDdf.Exists() || _fieldExt.Exists();
        }
        public void Build()
        {
            var uniqueFileNames = new HashSet<string>();

            
            {
                DropTables();
                if (_fileDdf.DataProvider is BtrieveDataProvider)
                    CreateBaseBtrieveFiles();
            }
            
            

            int fileId = _fileDdf.Max(_fileDdf.FileId) + 1;
            int fieldId = _fieldDdf.Max(_fieldDdf.FieldId) + 1;

            ShowProgressInNewThread p = null;
            if (!_underTests)
                p = new ENV.UI.ShowProgressInNewThread("Creating DDF files...");

            try
            {
                var holdFilesOpen = new BusinessProcess();
                holdFilesOpen.Entities.Add(new FileDdf(_db, _resultPath));
                holdFilesOpen.Entities.Add(new FieldDdf(_db, _resultPath));
                holdFilesOpen.Entities.Add(new IndexDdf(_db, _resultPath));
                holdFilesOpen.Entities.Add(new FieldextDdf(_db, _resultPath));
                holdFilesOpen.ForFirstRow(() =>
                {
                    foreach (var e in _entities)
                    {
                        if (p != null)
                            p.Progress(fileId);

                        _fileDdf.Insert(() =>
                        {
                            _fileDdf.FileId.Value = fileId;
                            _fileDdf.FileName.Value = GetUniqueName(_useCaptions ? e.Caption : e.SqlName, uniqueFileNames);
                            _fileDdf.FileLoc.Value =_filePrefix+ System.IO.Path.GetFileName(PathDecoder.DecodePath(e.BtrieveName));
                            _fileDdf.Flags.Value = e.Owner == "..SC...." ? 16 : 0;
                            _fileDdf.Filler.Value = new string('\0', 10);
                        });

                        int offset = 0;
                        var fields = new HashSet<string>();
                        var columnToId = new Dictionary<ColumnBase, int>();
                        var blobs = new List<BlobInfo>();
                        foreach (var c in e.Columns.ToArray())
                        {
                            if (c.Name != "Xf$Reserved" || UserSettings.Version10Compatible)
                            {
                                columnToId.Add(c, fieldId);
                                var ds = new BinaryValueSaver();
                                int flags = 0;
                                BtrieveDataProvider.ColumnSaver.SaveColumn(c, ds);
                                if (c is BoolColumn && ds.DataTypeCode == 0)
                                    ds.DataTypeCode = 7;
                                else if (c is TextColumn && ((TextColumn)c).Storage is ByteArrayTextStorage && ds.DataTypeCode == 0)
                                    ds.DataTypeCode = 13;
                                else if (c is ByteArrayColumn&&ds.DataTypeCode==0) {
                                    ds.DataTypeCode = 13;
                                    flags = 4096;
                                    ds.ValueByteArray = new byte[28];
                                    
                                }
                                _fieldDdf.Insert(() =>
                                {
                                    _fieldDdf.FieldId.Value = fieldId;
                                    _fieldDdf.FileId.Value = fileId;
                                    _fieldDdf.FieldName.Value = GetUniqueName(_useCaptions ? c.Caption : c.Name, fields);
                                    _fieldDdf.BtDataType.Value = ds.DataTypeCode;
                                    _fieldDdf.Offset.Value = offset;
                                    _fieldDdf.Size.Value = ds.ValueByteArray.Length;
                                    _fieldDdf.Decimals.Value = GetDecimals(c);
                                    _fieldDdf.Flags.Value = flags;
                                });
                                if (ds.DataTypeCode == 13)
                                {
                                    blobs.Add(new BlobInfo
                                    {
                                        fieldId = fieldId,
                                        length = ds.ValueByteArray.Length
                                    });
                                }
                                else
                                    offset += ds.ValueByteArray.Length;

                                int extendedDataType;
                                if (TryGetExtendedDataType(c, out extendedDataType))
                                {
                                    _fieldExt.Insert(() =>
                                    {
                                        _fieldExt.FileID.Value = fileId;
                                        _fieldExt.FieldID.Value = fieldId;
                                        _fieldExt.ExtendedDataType.Value = extendedDataType;
                                    });
                                }

                                fieldId++;
                            }
                        }
                        foreach (var item in blobs)
                        {
                            _fieldDdf.Update(_fieldDdf.FieldId.IsEqualTo(item.fieldId), () => {

                                _fieldDdf.Offset.Value = offset;
                                offset += item.length;
                            });
                        }

                        int keyNumber = 0;
                        foreach (var idx in e.Indexes)
                        {
                            _fieldDdf.Insert(() =>
                            {
                                _fieldDdf.FieldId.Value = fieldId++;
                                _fieldDdf.FileId.Value = fileId;
                                _fieldDdf.FieldName.Value = GetUniqueName(_useCaptions ? idx.Caption : idx.Name ?? idx.Caption, fields);
                                _fieldDdf.BtDataType.Value = 255;
                                _fieldDdf.Offset.Value = keyNumber;

                            });
                            int keySegment = 0;
                            foreach (var segment in idx.Segments.ToArray())
                            {
                                _indexDdf.Insert(() =>
                                {
                                    _indexDdf.FileId.Value = fileId;
                                    _indexDdf.FieldId.Value = columnToId[segment.Column];
                                    _indexDdf.KeyNumber.Value = keyNumber;
                                    _indexDdf.KeySegment.Value = keySegment++;
                                    _indexDdf.Flags.Value = BtrieveDataProvider.GetKeyFlags(idx, segment, keySegment);
                                });
                            }

                            keyNumber++;
                        }

                        fileId++;
                    }
                });
            }
            finally
            {
                if (p != null)
                {
                    p.Dispose();
                }
            }
        }
        public class TableInfo
        {
            public string name;
            public List<string> Columns = new List<string>();
        }
        public static void TestDDf(IEntityDataProvider db, string path, ApplicationControllerBase app)
        {
            ForeachEntityInDDF(db, path, app, (be, origName) =>
            {
                if (be.SqlName != origName.name)
                {
                    System.Console.WriteLine("t.Test(\"{0}\", \"{1}\");", be.Caption, origName.name);
                }
                else
                {

                }
                for (int i = 0; i < be.Columns.Count; i++)
                {
                    if (be.Columns[i].Name != origName.Columns[i])
                    {
                        System.Console.WriteLine("t.Test(\"{0}\", \"{1}\");/* but got {2}*/", be.Columns[i].Caption, origName.Columns[i], be.Columns[i].Name);
