        public static void ForeachEntityInDDF(IEntityDataProvider db, string path, ApplicationControllerBase app, Action<BtrieveEntity, TableInfo> doIt)
        {

            var dic = new Dictionary<string, TableInfo>();
            var f = new FileDdf(db, path);

            f.ForEachRow(() =>
            {
                var x = new TableInfo { name = f.FileName.Trim() };
                dic.Add(System.IO.Path.GetFileName(f.FileLoc.Trim()), x);

                var fieldInfo = new FieldDdf(db, path);

                fieldInfo.ForEachRow(fieldInfo.FileId.IsEqualTo(f.FileId), fieldInfo.SortBykey1_fieldId, () =>
                {
                    x.Columns.Add(fieldInfo.FieldName.Trim());
                });
            });


            int match = 0;
            int nonMatch = 0;



            foreach (var item1 in app.AllEntities._entities)
            {
                var item = item1.Value;
                if (typeof(BtrieveEntity).IsAssignableFrom(item))
                {
                    var be = System.Activator.CreateInstance(item) as BtrieveEntity;
                    var fe = System.IO.Path.GetFileName(PathDecoder.DecodePath(be.BtrieveName));
                    TableInfo origName;
                    if (dic.TryGetValue(fe, out origName))
                    {
                        dic.Remove(fe);
                        doIt(be, origName);
                    }
                    else
                    {

                    }




                }
            }
        }

        void DropTables()
        {
            if (_fileDdf.Exists())
                _fileDdf.Drop();
            if (_fieldDdf.Exists())
                _fieldDdf.Drop();
            if (_indexDdf.Exists())
                _indexDdf.Drop();
            if (_fieldExt.Exists())
                _fieldExt.Drop();
        }

        void CreateBaseBtrieveFiles()
        {
            const string fileDdf = "";
            const string fieldDdf = "";
            const string indexDdf = "";
            const string fieldExtDdf = "";

            var u = UserMethods.Instance;
            u.Blb2File(Convert.FromBase64String(fileDdf), _fileDdf.BtrieveName);
            u.Blb2File(Convert.FromBase64String(fieldDdf), _fieldDdf.BtrieveName);
            u.Blb2File(Convert.FromBase64String(indexDdf), _indexDdf.BtrieveName);
            u.Blb2File(Convert.FromBase64String(fieldExtDdf), _fieldExt.BtrieveName);
        }

        static string GetUniqueName(string name, HashSet<string> names)
        {
            name = name.Trim().Substring(0, Math.Min(name.Length, 20));
            var result = name;
            for (int i = 1; names.Contains(result.ToUpper()); i++)
            {
                result = name;
                if (result.Length + i.ToString().Length + 1 >= 20)
                    result = result.Remove(result.Length - i.ToString().Length - 1);
                result = result + "_" + i.ToString();
            }
            names.Add(result.Trim().ToUpper());
            return result;
        }

        int GetDecimals(ColumnBase column)
        {
            var nc = column as NumberColumn;
            if (nc != null)
            {
                return nc.FormatInfo.Scale;
            }

            return 0;

        }

        bool TryGetExtendedDataType(ColumnBase column, out int extendedDataType)
        {
            {
                var typedColumn = column as NumberColumn;
                if (typedColumn != null && typedColumn.Storage is LegacyNumberStorage)
                {
                    extendedDataType = 235;
                    return true;
                }
            }
            {
                var typedColumn = column as DateColumn;
                if (typedColumn != null)
                {
                    if (typedColumn.Storage is ByteArrayDateStorage)
                    {
                        extendedDataType = 244;
                        return true;
                    }

                    if (typedColumn.Storage is NumberDateStorage)
                    {
                        extendedDataType = 233;
                        return true;
                    }
                }
            }
            {
                var typedColumn = column as TimeColumn;
                if (typedColumn != null)
                {
                    extendedDataType = 240;
                    return true;
                }
            }

            extendedDataType = 0;
            return false;

        }

        public void CompareForTesting(string compareDDfLocation)
        {
            ExportTable(_fileDdf);
            ExportTable(_fieldDdf);
            ExportTable(_indexDdf);
            ExportTable(_fieldExt);

            var btr = new BtrieveDataProvider();
            var mgcFile = new FileDdf(btr, compareDDfLocation);
            var mgcField = new FieldDdf(btr, compareDDfLocation);
            var mgcIndex = new IndexDdf(btr, compareDDfLocation);
            var mgcFieldExt = new FieldextDdf(btr, compareDDfLocation);

            foreach (var e in new BtrieveEntity[] { mgcFile, mgcField, mgcIndex, mgcFieldExt })
            {
                ExportTable(e);
            }

            // Windows.OSCommand($@"""C:\Program Files\Beyond Compare 4\BCompare.exe"" {compareDDfLocation} {_resultPath}");
        }

        static void ExportTable(Entity e)
        {
            using (var fw = new StreamWriter(e.EntityName + ".txt", false, LocalizationInfo.Current.OuterEncoding))
            {
                e.ForEachRow(null, new Sort(e.Columns[0], e.Columns[1], e.Columns[2]),
                    () => fw.WriteLine(string.Join(",", e.Columns.ToArray().Select(c =>
                    {
                        if (c is NumberColumn)
                            c.Format = "5";
                        if (c.Name == "filler")
                            return c.ToString().Trim();
                        return c.ToString();
                    }))));
            }
        }

        internal void AssertFile(int fileId, string fileName, string fileLoc, int flags, string filler)
        {
            var bp = new BusinessProcess { From = _fileDdf };
            bp.ForFirstRow(_fileDdf.FileId.IsEqualTo(fileId), () =>
            {
                string message = "FileId: " + fileId;
                _fileDdf.FileName.ShouldBe(fileName, message + " fileName:");
                _fileDdf.FileLoc.ShouldBe(fileLoc, message + " fileLoc:");
                _fileDdf.Flags.Value.ShouldBe(flags, message + " flags:");
                _fileDdf.Filler.ShouldBe(filler, message + " filler: ");
            }).ShouldBe(true, "File not found " + fileName);
        }

        internal void AssertField(int fieldId, int fileId, string fieldName, int btDataType, int offset, int size, int decimals, int flags)
        {
            var bp = new BusinessProcess { From = _fieldDdf };
            bp.ForFirstRow(_fieldDdf.FieldId.IsEqualTo(fieldId), () =>
            {
                string message = "FieldId: " + fieldId;
                _fieldDdf.FileId.Value.ShouldBe(fileId, message + " fileId:");
                _fieldDdf.FieldName.Value.ShouldBe((Text)fieldName, message + " fieldName:");
                _fieldDdf.BtDataType.Value.ShouldBe(btDataType, message + " btDataType:");
                _fieldDdf.Offset.Value.ShouldBe(offset, message + " offset:");
                _fieldDdf.Size.Value.ShouldBe(size, message + " size: ");
                _fieldDdf.Decimals.Value.ShouldBe(decimals, message + " decimals:");
                _fieldDdf.Flags.Value.ShouldBe(flags, message + " flags:");
            }).ShouldBe(true, fieldName + " not found");
        }

        internal long AssertField(int fieldId, Action<FieldDdf> what)
        {
            return _fieldDdf.ForEachRow(_fieldDdf.FileId.IsEqualTo(fieldId), () => what(_fieldDdf));
        }

        public long AssertExtendedDataType(int fileId, int fieldId, Action<FieldextDdf> what)
        {
            return _fieldExt.ForEachRow(_fieldExt.FileID.IsEqualTo(fileId).And(_fieldExt.FieldID.IsEqualTo(fieldId)),
                () => what(_fieldExt));
        }
    }

    internal class FileDdf : BtrieveEntity
    {
        #region Columns
        internal readonly NumberColumn FileId = new NumberColumn("Xf$Id", "2", "fileId") { Storage = BtrieveMigration.UShortNumberStorage() };
        internal readonly TextColumn FileName = new TextColumn("Xf$Name", "20", "fileName");
        internal readonly TextColumn FileLoc = new TextColumn("Xf$Loc", "64", "fileLoc");
        internal readonly NumberColumn Flags = new NumberColumn("Xf$Flags", "3", "flags") { Storage = BtrieveMigration.ByteNumberStorage() };
        internal readonly TextColumn Filler = new TextColumn("Xf$Reserved", "10");

        #endregion

        #region Indexes

        readonly Index SortBykey1_id = new Index { Caption = "key 1(id)", Name = "key1_id", AutoCreate = true, Unique = true };
        readonly Index SortBykey2_name = new Index { Caption = "key 2(name)", Name = "key2_name", AutoCreate = true, Unique = true };

        #endregion

        internal FileDdf(IEntityDataProvider db, string path) : base("X$File", "file.ddf", db, "", "file.ddf")
        {
            this.BtrieveName = System.IO.Path.Combine(path, BtrieveName);
            CheckDuplicateIndex = true;
            Cached = false;
            Owner = "..SC....";
            InitializeIndexes();
            UseRowIdForPrimaryKey();
        }

        void InitializeIndexes()
        {
            SortBykey1_id.Add(FileId);
            SortBykey2_name.Add(FileName);
        }
    }

    internal class FieldDdf : BtrieveEntity
    {
        #region Columns
        internal readonly NumberColumn FieldId = new NumberColumn("Xe$Id", "3", "filedId") { Storage = BtrieveMigration.UShortNumberStorage() };
        internal readonly NumberColumn FileId = new NumberColumn("Xe$File", "3", "fileId") { Storage = BtrieveMigration.UShortNumberStorage() };
        internal readonly TextColumn FieldName = new TextColumn("Xe$Name", "20", "fieldName");
        internal readonly NumberColumn BtDataType = new NumberColumn("Xe$DataType", "3", "btDataType") { Storage = BtrieveMigration.ByteNumberStorage() };
        internal readonly NumberColumn Offset = new NumberColumn("Xe$Offset", "5", "offset") { Storage = BtrieveMigration.UShortNumberStorage() };
        internal readonly NumberColumn Size = new NumberColumn("Xe$Size", "5", "size") { Storage = BtrieveMigration.ShortNumberStorage() };
        internal readonly NumberColumn Decimals = new NumberColumn("Xe$Dec", "3", "decimals") { Storage = BtrieveMigration.ByteNumberStorage() };
        internal readonly NumberColumn Flags = new NumberColumn("Xe$Flags", "3", "flags") { Storage = BtrieveMigration.ShortNumberStorage() };
        #endregion
        #region Indexes
        public readonly Index SortBykey1_fieldId = new Index { Caption = "key 1(field id)", Name = "key1_fieldId", AutoCreate = true, Unique = true };
        readonly Index SortBykey2_fileId = new Index { Caption = "key 2(file id)", Name = "key2_fileId", AutoCreate = true };
        readonly Index SortBykey3_fieldName = new Index { Caption = "key 3(field name)", Name = "key3_fieldName", AutoCreate = true };
        readonly Index SortBykey4_fileId_field = new Index { Caption = "key 4(file id+field", Name = "key4_fileId_field", AutoCreate = true, Unique = true };
        readonly Index SortBykey5_fi_offset_dec = new Index { Caption = "key 5(fi+offset+dec)", Name = "key5_fi_offset_dec", AutoCreate = true };
        #endregion
        internal FieldDdf(IEntityDataProvider db, string path) : base("X$Field", "field.ddf", db, "", "field.ddf")
        {
            this.BtrieveName = System.IO.Path.Combine(path, BtrieveName);
            //CheckDuplicateIndex = true;
            Cached = false;
            Owner = "..SC....";
            InitializeIndexes();
            UseRowIdForPrimaryKey();
        }
        void InitializeIndexes()
        {
            SortBykey1_fieldId.Add(FieldId);
            SortBykey2_fileId.Add(FileId);
            SortBykey3_fieldName.Add(FieldName);
            SortBykey4_fileId_field.Add(FileId, FieldName);
            SortBykey5_fi_offset_dec.Add(FileId, Offset, Decimals);
        }

        internal bool Contains(int fileId, string name)
        {
            return Contains(FileId.IsEqualTo(fileId).And(FieldName.IsEqualTo(name)));
        }
    }

